import React from 'react';
import { Outlet ,Link} from 'react-router-dom';

const Section = () => {

    const navigate = () => {
        navigate('/application/HHIND');
    }
    

    return (
        <>
            <h1>hi</h1>
            <div>
                <Link to="/dasboard">
                    <a>&lt;- Back to Dashboard</a>
                </Link>
            </div>
            <div className='section-margin'>
                <Outlet />
            </div>
            <button className='blue-button' onClick={navigate}>Next &gt;</button>
        </>
    )
}
export default Section;
